CREATE DATABASE IF NOT EXISTS luxurywatch;

USE luxurywatch;

CREATE TABLE IF NOT EXISTS `luxury_watch` (
    `id` INT AUTO_INCREMENT PRIMARY KEY,
    `Brand` VARCHAR(50),
    `Model` VARCHAR(50),
    `Case_Material` VARCHAR(50),
    `Strap_Material` VARCHAR(50),
    `Movement_Type` VARCHAR(50),
    `Water_Resistance` VARCHAR(50),
    `Case_Diameter_mm` FLOAT,
    `Case_Thickness_mm` FLOAT,
    `Band_Width_mm` INT,
    `Dial_Color` VARCHAR(50),
    `Crystal_Material` VARCHAR(50),
    `Complications` VARCHAR(50),
    `Power_Reserve` VARCHAR(50),
    `Price_USD` VARCHAR(50)
);

`